import "./style.css"
import Banner from "../../compoments/Banner"
import { useEffect, useState } from "react"

export default function Home() {
    const [items, setItems] = useState([])

    useEffect(() => {
        fetch("/logements.json")
        .then((e) => e.json())
        .then((data) => {
            setItems(data)
        })
    }, [])

    return (
        <div className="Home">
            <Banner />
            <div className="articlesbloc">
            {items.map((item, id) => (
                <div className="article" key={id}>
                    <img className="article-img" src={item.cover} alt="article-img" />
                    <h3 className="article-text">{item.title}</h3>
                </div>
            ))}
            </div>
        </div>
    )
}
